sys_ux_client_script.script:
/**
 * @param {params} params
 * @param {api} params.api
 * @param {TransformApiHelpers} params.helpers
 */
function evaluateProperty({
    api,
    helpers
}) {
    if (api.data.gform.nowRecordCommonHeader.tableDisplayValue === "Subjects") {
        return {
            "minRatio": 20,
            "minPixels": 720
        };
    } else {
       return {
            "minRatio": 100,
            "minPixels": 720
        };
    }
}
